# This solution is correct but giving TLE on leetcode
from collections import deque
from typing import List
import math
class Solution:
    def findLadders(self, beginWord: str, endWord: str, wordList: List[str]) -> List[List[str]]:
        if endWord not in wordList:
            return []
        if beginWord not in wordList:
            wordList.append(beginWord)
        n = len(wordList)
        dic = {}
        for i in wordList:
            dic[i] = 0
        l = len(beginWord)
        q = deque()
        q.append((beginWord,1,[beginWord]))
        res = []
        self.bfs(dic,q,endWord,l,res)
        return res
    def bfs(self,dic,q,dest,l,res):
        min_d = math.inf
        words_used = []
        last_level = 1
        while(q):
            k,d,p = q.popleft()
            dic[k] = 1
            if d > last_level:
                for i in words_used:
                    dic[i] = 1
                last_level = d
            if k==dest and d == min(d,min_d):
                min_d = min(d,min_d)
                res.append(p)
            for c in range(l):
                new_str_list = list(k)
                for i in range(26):
                    new_str = new_str_list
                    new_str[c] = chr(97+i)
                    new_str = "".join(new_str)
                    if new_str in dic and dic[new_str] == 0:
                        words_used.append(new_str)
                        q.append([new_str,d+1,p+[new_str]])
        return res

